import * as React from 'react';
import Image from 'next/image';

import styles from './about.module.scss';

const About: React.FC = () => {
  return (
    <div className={styles.about}>
      <Image src="/me.jpeg" width="auto" height="auto" alt="profile" />
    </div>
  );
};

export { About };
